float expint(float x) {
	int i = -1;
	float egamma = 0.577215664902f;
	int input = int( x * 1000);
	if (input > 9600) {
		return 0.f;
     }
	else if(input>6000) {
		i = (input - 6000) / 100 + 1499;
		return res_expint[i];
	}
	else if (input > 1000) {
		i = (input - 1000) / 10 + 999;
		return res_expint[i];
	}
	else if (input > 0) {
		i = input -1;
		return res_expint[i];
	}
	return  (-egamma - logf(x));
	
	
}
